import React, {Component} from "react";
import "./bAndA.css";
import Before1 from "../../assets/before1.png";
import After1 from "../../assets/after1.png";
import Before from "./before/before";
import After from "./after/after";

class BAndA extends Component {
  render() {
  return (
    <section>
      <div className="gridArea">
        <div className="before ">
          <img className="before1" imgscr={Before1}></img>

        <div className="beforeText">
          <p>fegrgtrgtrgtrg</p>
        </div>
        </div>

        <div className="afterText">
          <p>efgrgwtrgrtgtg</p>
        </div>
        <div className="after">
        <img className="after1" imgscr={After1}></img>
        </div>
      </div>

    </section>
  );
}
}

export default BAndA;
